Kabupatèn Blitar (Carakan: , Pegon: كابوڤاتين بليتار), inggih punika salah sawijining kabupatèn ing tlatah Jawa Wétan mawi kutha krajan ing Kanigara. Jembaripun kabupatèn punika sawatawis 1,588.79 km2.
Géografi.
Blitar, kutha lan kabupatèn, dumunung ing sikil Gunung Kelud, Jawa Wétan. Tlatah Blitar tansah kapapar lahar Gunung Kelud kang wis njeblug ping puluhan wiwit taun 1331. Lapisan lemah vulkanik kang ditemokaké ing Blitar iku sejatiné minangka asil saka lahar beku Gunung Kelud kang njeblug sacara périodik wiwit pirang-pirang taun kepungkur.
Kali Brantas kang mili saka wétan menyang kulon mbagi Kabupaten Blitar dadi loro, yaiku sisih lor lan kidul. Sisih kidul Kabupatèn Blitar (asring diarani Blitar Kidul) akèh-akèhé saka jinis lemah grumusol. Lemah kang kaya ngono iku mung produktif menawa digunakaké kanggo nandur pohung, jagung, saha jati.
