Kabupatèn Gresik (Carakan: , Pegon: كَبُڤَتَينْ ڬرٚسِكْ), iku kabupatèn ing Jawa Wétan, kutha Gresik iku kutha krajan kabupatèné, kutha-kutha liyané:, lan liya-liyané. Jembar wewengkon Kabupatèn iki ± 1,191.25 km² utawa hèktar.
Sajarah.
Gresik wis kaloka wiwit abad kaping 11 nalika tuwuh dadi punjer dedagangan ora mung antarpulo, nanging wis sumrambah menyang manca Nagara. Minangka kutha bandhar, Gresik akèh ditekani para pedagang Cina, Arab, Gujarat, Kalkuta, Siam, Bengali, Campa, lan liya-liyané. Gresik wiwit tampil pinunjul sajeroning wacana sajarah wiwit tuwuhing agama Islam ing tanah Jawa. Panyebar agama Islam mau yaiku Syech Maulana Malik Ibrahim sing bebarengan karo Fatimah Binti Maimun lumebu ke Gresik ing wiwitan abad kaping 11.
Wiwitané kabupatèn ini jenengé Kabupatèn Surabaya. Kanthi anané PP Nomer 38 Taun 1974 kagiyatan papréntahan baka sethithik dipindhah menyang Gresik lan jenengé banjur owah dadi Kabupatèn Daerah Tingkat II Gresik kanthi punjer kagiyatan ing Kutha Gresik.
Géografi.
Kabupatèn iki jembaré 1.137,05 km2 kanthi sing ndunungi 1.072.190 jiwa (2004). Kabupatèn Gresik dumunung ing posisi sing strategis yaiku antara 7' LS-8' LS lan 112' BT-133' BT. Sapérangan gedhé wewengkon wujud dataran cendhèk kanthi èlevasi antara 0-12 mèter sadhuwuring lumahing banyu sagara kajaba sapérangan cilik ing sisih lor (Kacamatan Panceng) èlevasiné nganti 25 mèter sadhuwuring banyu sagara.
