Kutha Kadhiri duwé sajarah kang mulya. Kadhiri ing jaman biyèn dadi laladan wigati ing nusantara. Pusating kraton ing nusantara pas wektuné. Kadhiri uga dadi laladan cikal bakal lairé kraton-kraton gedhé kang minayungi kraton-kraton liya.
Géografi.
Kadhiri kuta kang ana ing pèrènging Kali Brantas. Wates-wates Kutha Kadhiri yaiku; wates lor ana Kabupatèn Kadhiri, wates Kidul ana Blitar-Tulungagung, wates wétan ana Malang, wates kulon ana Nganjuk. Kadhiri iku kutha kang ngapit Kali Brantas, mula diarani kaya duwé rong pérangan yaiku Kadhiri Kulon Kali lan Kadhiri Wétan Kali. Yén miturut pétungan géografis, Kadhiri dumunung ing 111,05°-112,03° Bujur wétan lan 7,45°-7,55° Lintang kidul
