Kutha Malang (Aksara Jawa: , Pegon: كَوتَ مَلَڠْ) inggih punika salah satunggaling kutha kang manggon ing Jawa Wétan, Indonésia. Kutha Malang dipunadegaken nalika jamaning papréntahan Walanda ing tanggal 1 April 1914 lan E. K Broeveldt njabat dados walikutha ka-1. Kutha puniki mapan ing dataran dhuwur sa-wiyar 145,28 km² saéngga ndadosaken Kutha Malang dados kutha paling ageng ka-2 ing Jawa Wétan sasampunipun Surabaya lan kutha paling ageng ka-12 ing Indonésia. Bareng-bareng kaliyan Kutha Batu lan Kabupatèn Malang, Kutha Malang nyawiji ing daerah kang manunggal kang diwastani Malang Raya.
Kutha Malang iki dikenal apik minangka kutha pandhidhikan amarga duwéni akéh lembaga pandhidhikan awit sekolah dhasar nganti sekolah dhuwur utawi universitas kang kualitasipun apik. Sakliyané kutha pandhidhikan, kutha iki uga dikenal minangka salah sawijining kutha tujuan pariwisata ing Indonésia amarga kutha iki ana ing dataran kang dhuwur saéngga ndadékaké kutha iki duwéni pemandangan kang apik banget.
