Wewengkon Kutha Ngayogyakarta gumêlar ing antarané 110° 24′ 19″ nganti 110° 28′ 53″ Bujur Wétan lan 7° 15′ 24″ nganti 7° 49′ 26″ Lintang Kidul kanthi dhuwuring èlevasi rata-rata 114 m sadhuwuré lumahing sagara. Luas wilayah Kota Yogyakarta iku 32,5 km².  
