Sléman (Jawa: ꦑꦧꦸꦥꦠꦺꦤ꧀ꦯ꧀ꦭꦺꦩꦤ꧀) iku kabupatèn ing Daerah Istimewa Yogyakarta, pernahé ing sisih lor DIY, kutha Sléman iku minangka kutha krajan kabupatèné, kutha-kutha liyané:, lan liya-liyané. Jembar wewengkon kabupatèn iki ± 574,82 km² utawa hèktar.
Kabupatèn iki wewatesan karo Provinsi Jawa Tengah ing sisih lor lan wétan, Kabupatèn Gunungkidul, Kabupatèn Bantul, lan Kutha Ngayogyakarta ing sisih kidul, sarta Kabupatèn Kulon Praga ing sisih kulon. Sléman kaloka minangka asal woh salak pondoh. Manéeka pendhidhikan dhuwur kang ana ing Yogyakarta sabeneré kanthi administrasi dumunung ing wewengkon kabupatèn iki, antarané Universitas Gadjah Mada lanUniversitas Negeri Yogyakarta.
Pusat papréntahan dumunung ing Kacamatan Sléman, kang pernahé ana ing jalur utama antara Yogyakarta-Semarang. Kanthi Pametu Asli Laladan Rp. 52.978.731.000,-(2005) Kabupatèn Sléman minangka Kabupatèn paling sugih ing Provinsi Daerah Istimewa Yogyakarta.
Géografi.
Kabupatèn iki wewatesan karo Provinsi Jawa Tengah ing sisih lor lan wétan, Kabupatèn Gunungkidul, Kabupatèn Bantul, lan Kutha Ngayogyakarta ing sisih kidul, sarta Kabupatèn Kulon Praga ing sisih kulon.
Pérangan lor kabupatèn iki wujud tlatah pagunungan, kanthi pucuk pucuké wujud Gunung Merapi ing tapel wates karo Jawa Tengah, salah siji gunung geni aktif kang paling mbebayani ing Pulau Jawa. Déné ing sisih kidul wujud dhataran cendhèk kang subur. Ing antara kali-kali gedhé kang mili ngliwati kabupatèn iki yaiku Kali Praga (mbatesi kabupatèn Sléman karo Kabupatèn Kulon Praga), Kali Codhé, lan Kali Tapus.
