Kidung Sesingir iki salah sijiné sastra Jawa Anyar sing migunakaké tembang Macapat. Kidung Sesingir kaanggit déning Susuhunan Paku Bawana IX.
Seratan kawiwitan kanthi tembang Kinanthi, ya iku:&lt;br&gt;
"Kinanthi amurwaning kidung"&lt;br&gt;
"sinarèndra kang mandhiri"&lt;br&gt;
"Surakarta kaping IX"&lt;br&gt;
"kuwara widagdêng kawi"&lt;br&gt;
"wasisé gendhing wis kondhang"&lt;br&gt;
"mumpuni kidung palupi"
Saliyané Kinanthi, Paku Bawana IX uga ngagem Mijil, Gambuh, Sinom, Pucung, Pangkur, Maskumambang, Durma, Megatruh, Asmarandana, Sinom, Dhandhanggula, lan Girisa.
Isiné piwulang prakara urip. Upamané ing tembang Dhandhanggula iki:&lt;br&gt;
"Wus winawas ing jaman samangkin"&lt;br&gt;
"akèh wong mangerti basaning liyan"&lt;br&gt;
"kapiran basané dhéwé"&lt;br&gt;
"jamané wong mèt kawruh"&lt;br&gt;
"den salesih wajibirêki"&lt;br&gt;
"den manggon tékadira"&lt;br&gt;
"ywa was-wasing kalbu"&lt;br&gt;
"iku lagi ngupayakna"&lt;br&gt;
"kawruhing liyan dadiya busanêng nagri"&lt;br&gt;
"ywa malbu kalbunira&lt;br&gt;"

